import React, {useState} from 'react';

import '../Styles/Predict.css'

function Predict() {
    return (
        <div class="slider-container">
            <Slider
                min={5}
                step={1}
                max={30}
                valueLabelDisplay="auto"
                aria-labelledby="non-linear-slider"
            />
        </div>
    )
}

export default Predict;
